- name: "AgentName"
  description: "Check default enrollment"
  configuration_parameters:
  metadata:
    stages:
    -
      input: "OSSEC A:'user1'\n"
      output: "OSSEC K:'"
    groups:
      -

- name: "Single Group - Valid group"
  description: "Check single group enrollment"
  configuration_parameters:
  metadata:
    stages:
    -
      input: "OSSEC A:'user2' G:'Group1'\n"
      output: "OSSEC K:"
    groups:
      - 'Group1'
      - 'Group2'

